(async function() {
  const args = process.argv.slice(2);
  const outDir = args[0] || "./out";

  Object.keys(traits).forEach(async key => {
    const traitPath = path.join(outDir, key);
    await fs.mkdir(traitPath, { recursive: true });
    traits[key].forEach(async trait => {
      const name = `${key}_${trait.name.replace(/\s/g, "_")}`.toLowerCase();
      const imagePath = path.join(traitPath, `${name}.png`);
      const image = trait.image.split("data:image/png;base64,")[1];
      await fs.writeFile(imagePath, image, "base64");
    });
  });
})();

